import React from 'react';

const MarketAnalysis = ({ appraisal }) => {
  return (
    <div className="p-4">
      <h2 className="text-2xl font-bold mb-2">Market Analysis</h2>
      <p>
        This is the market analysis tab. Add market trends, statistics, and charts
        here.
      </p>
      {appraisal && (
        <div className="mt-4 p-4 bg-gray-50 rounded-lg">
          <h3 className="text-lg font-semibold mb-2">Property Context:</h3>
          <p className="text-sm text-gray-600">
            Analyzing market conditions for {appraisal.address}
          </p>
        </div>
      )}
    </div>
  );
};

export default MarketAnalysis;
